import React, { Component } from 'react';
import { Box, Button } from 'grommet';

class Header extends Component {
	render() {
		return (
			<Box direction="row" gap="medium" pad={{ left: 'medium' }}>
				<Button>
                    Generate new array
                </Button>
			</Box>
		);
	}
}

export default Header;
